"bebird is a professional personal health care app. It is connected to the bebird visual ear picking instrument through wifi, and the app can display the real-time picture of cleaning the ear canal. Individuals can easily and safely enjoy the ear picking process.
The ear picking process can be photographed and videotaped. In order to prevent the ear picking process from accidentally touching the screen, there is also a lock screen function during the ear picking process;
Through the App, you can easily purchase visual earphones and accessories suitable for you and your family. "

Marvelight is a smart light APP. 
It controls mood lights and other light fixtures. 
With the APP and compatible light fixtures, you will enjoy a marvelous time!
Its features:
1. Set color, max to 16 million colors ;
2. Tune brightness ;
3. Set various light modes and scenes ;
4. Change light color with music or sound ;
5. Pick color from camera to light ;
6. Set timer for light on/off ;
7. Shake phone to change light color ;

【Edit】
Freely insert and edit text, one-dimensional-code, two-dimensional code, forms, logos, pictures, date and time, ect.;
【Batch Printing】
Support Excel data table import, achieve batch printing;
【Scan Printing】
By scanning, time will be saved. The scanning content can be freely transferred to text, one-dimensional code and two-dimensional code;
【Number】
Numbers can be set, print in sequence for both text and barcodes;
【Label Template】
The built-in label template covers 15 regions, such as clothing, jewelry, supermarket, communications, office, food and household. The number of the label template is up to 500. It can be applied with one key, which saves time and improves work efficiency;
【Intelligent Search】
The powerful intelligent search system provides a variety of keyword search, which makes finding a label template more convenience and faster.
